START TRANSACTION;
CREATE TABLE IF NOT EXISTS `players` (
	`id`	INT,
	`first_name`	VARCHAR(100),
	`last_name`	VARCHAR(100),
	`bats`	VARCHAR(100),
	`throws`	VARCHAR(100),
	`weight`	INT,
	`height`	INT,
	`debut`	DATE,
	`final_game`	DATE,
	`birth_year`	INT,
	`birth_month`	INT,
	`birth_day`	INT,
	`birth_city`	VARCHAR(100),
	`birth_state`	VARCHAR(100),
	`birth_country`	VARCHAR(100),
	PRIMARY KEY (`id`)
);
COMMIT;
